insert into wcm_article (ID,VERSION,ARTICLE_TYPE,NAME,HEADLINE,MAIN_IMAGE_ID,THUMBNAIL_IMAGE_ID,TITLE,DESCRIPTION,AUTHOR,POST_DATE,START_DATE,END_DATE,PARENT_FOLDER_ID,LAST_MOD_USER_ID,LAST_MOD_DATE,CREATION_USER_ID,CREATION_DATE,ARTICLE_BODY,ABSTRACT) values ('a30002',3,null,'Article Content','Tires - Appleton, WI Fleet Farm',null,null,null,null,null,null,null,null,null,null,to_timestamp('09-AUG-16 07.28.47.530000000 AM','DD-MON-RR HH.MI.SS.FF AM'),null,to_timestamp('21-JUL-16 11.56.09.000000000 AM','DD-MON-RR HH.MI.SS.FF AM'),'The selection of tires in Appleton, MN has gotten better! Fleet Farm has added a number of quality tires brands to the top brands that have been proudly offered for years. Cooper tires have long been offered at Fleet Farm, as have Road Runner and Mastercraft tires. The newest additions to name brand tires in Appleton are Michelin, BFGoodrich, and Uniroyal. You''ll find a wide selection of treads and tires for all seasons. Stop in and check out the selection of light truck tires, car tires, all-season tires, off-road tires, and more! Our tires specialists can help you to determine what tires brands and treads best suit your needs and your budget. They can also help you to determine the tire size that is recommended for your vehicle, should you need help with that. While your new tires are being mounted, you can browse through the store and you''ll be paged when your vehicle is ready to roll. Convenience and shopping in one trip. You can''t beat that!', EMPTY_CLOB());
