insert into wcm_article (ID,VERSION,ARTICLE_TYPE,NAME,HEADLINE,MAIN_IMAGE_ID,THUMBNAIL_IMAGE_ID,TITLE,DESCRIPTION,AUTHOR,POST_DATE,START_DATE,END_DATE,PARENT_FOLDER_ID,LAST_MOD_USER_ID,LAST_MOD_DATE,CREATION_USER_ID,CREATION_DATE,ARTICLE_BODY,ABSTRACT) values ('a30006',2,null,'Article with content 1','Tire Repair - Antigo, WI Fleet Farm',null,null,null,null,null,null,null,null,null,null,to_timestamp('09-AUG-16 07.30.46.063000000 AM','DD-MON-RR HH.MI.SS.FF AM'),null,to_timestamp('21-JUL-16 12.25.38.000000000 PM','DD-MON-RR HH.MI.SS.FF AM'),'Your Antigo, WI Fleet Farm Auto Center also offers tire repair. Bring in your flat tire and our tires specialists will have it ready to go in no time. Fleet Farm also stocks tire repair kits in the store''s Automotive Department should you choose to repair your tire yourself. Either way, Fleet Farm has tire repair in Antigo, WI covered and you''ll be up and running again in no time!', EMPTY_CLOB());
insert into wcm_article (ID,VERSION,ARTICLE_TYPE,NAME,HEADLINE,MAIN_IMAGE_ID,THUMBNAIL_IMAGE_ID,TITLE,DESCRIPTION,AUTHOR,POST_DATE,START_DATE,END_DATE,PARENT_FOLDER_ID,LAST_MOD_USER_ID,LAST_MOD_DATE,CREATION_USER_ID,CREATION_DATE,ARTICLE_BODY,ABSTRACT) values ('a20002',2,null,'Tires','Tires','m20008',null,null,null,null,null,null,null,null,null,to_timestamp('09-AUG-16 07.30.12.899000000 AM','DD-MON-RR HH.MI.SS.FF AM'),null,to_timestamp('20-JUL-16 05.12.31.000000000 PM','DD-MON-RR HH.MI.SS.FF AM'),'Check out Fleet Farm''s expanded selection of tires in Appleton, WI! Find Michelin tires, Cooper tires, Road Runner, Uniroyal, BFGoodrich, Mastercraft tires, and more! Get light-truck tires, SUV tires, performance tires, car tires, all-season tires, 4 x 4 tires, and off-road tires at Appleton, WI Fleet Farm!', EMPTY_CLOB());
