insert into wcm_article (ID,VERSION,ARTICLE_TYPE,NAME,HEADLINE,MAIN_IMAGE_ID,THUMBNAIL_IMAGE_ID,TITLE,DESCRIPTION,AUTHOR,POST_DATE,START_DATE,END_DATE,PARENT_FOLDER_ID,LAST_MOD_USER_ID,LAST_MOD_DATE,CREATION_USER_ID,CREATION_DATE,ARTICLE_BODY,ABSTRACT) values ('a30029',1,null,'AlexTires1','Tires - Alexandria, MN Fleet Farm',null,null,null,null,null,null,null,null,null,null,to_timestamp('03-AUG-16 06.46.28.725000000 AM','DD-MON-RR HH.MI.SS.FF AM'),null,to_timestamp('21-JUL-16 06.54.05.000000000 PM','DD-MON-RR HH.MI.SS.FF AM'),'The selection of tires in Alexandria, MN has gotten better! Fleet Farm has added a number of quality tires brands to the top brands that have been proudly offered for years. Cooper tires have long been offered at Fleet Farm, as have Road Runner and Mastercraft tires. The newest additions to name brand tires in Alexandria are Michelin, BFGoodrich, and Uniroyal. You''ll find a wide selection of treads and tires for all seasons. Stop in and check out the selection of light truck tires, car tires, all-season tires, off-road tires, and more! Our tires specialists can help you to determine what tires brands and treads best suit your needs and your budget. They can also help you to determine the tire size that is recommended for your vehicle, should you need help with that. While your new tires are being mounted, you can browse through the store and you''ll be paged when your vehicle is ready to roll. Convenience and shopping in one trip. You can''t beat that!', EMPTY_CLOB());
insert into wcm_article (ID,VERSION,ARTICLE_TYPE,NAME,HEADLINE,MAIN_IMAGE_ID,THUMBNAIL_IMAGE_ID,TITLE,DESCRIPTION,AUTHOR,POST_DATE,START_DATE,END_DATE,PARENT_FOLDER_ID,LAST_MOD_USER_ID,LAST_MOD_DATE,CREATION_USER_ID,CREATION_DATE,ARTICLE_BODY,ABSTRACT) values ('a30023',1,null,'Alex - Para 3','Get Sporting Goods in Alexandria, MN at Fleet Farm',null,null,null,null,null,null,null,null,null,null,to_timestamp('03-AUG-16 06.46.28.756000000 AM','DD-MON-RR HH.MI.SS.FF AM'),null,to_timestamp('21-JUL-16 06.50.54.000000000 PM','DD-MON-RR HH.MI.SS.FF AM'),'Get the sporting goods you''re looking for at Fleet Farm! Before your hunting or fishing excursion, stop at Fleet Farm to pick up your hunting license and check out the wide selection of firearms, hunting clothing, hunting boots, fishing apparel, fishing lures, live bait, and tackle boxes. Enjoy the great outdoors in many other ways with bikes, wagons, ATV accessories, boating supplies, camping goods, binoculars, Airsoft rifles, paintball supplies, and football, baseball, softball, soccer, and other outdoor sports equipment. Select games for your game room including ping pong tables, dart boards, a foosball table, and pool cues. Take on winter with snowshoes, sleds, saucers, hockey skates, figure skates, and cold weather gear. Set out on the open water in the warmer months with kayaks and canoes, jon boats, pedal boats, fishing boats, and boating accessories. You''ll find military surplus items in our sporting goods department, too! Fleet Farm also addresses your fitness needs with heavy bags, speed bags, bag gloves, weight sets, pedometers, and trampolines. Get your camp on with camping tents, sleeping bags, hatches, camp chairs, LED lanterns, flashlights, camp stoves, camp grills, and more!', EMPTY_CLOB());
insert into wcm_article (ID,VERSION,ARTICLE_TYPE,NAME,HEADLINE,MAIN_IMAGE_ID,THUMBNAIL_IMAGE_ID,TITLE,DESCRIPTION,AUTHOR,POST_DATE,START_DATE,END_DATE,PARENT_FOLDER_ID,LAST_MOD_USER_ID,LAST_MOD_DATE,CREATION_USER_ID,CREATION_DATE,ARTICLE_BODY,ABSTRACT) values ('a30034',1,null,'Test','Paragraph 1 Headline',null,null,null,null,null,null,null,null,null,null,to_timestamp('03-AUG-16 06.46.28.778000000 AM','DD-MON-RR HH.MI.SS.FF AM'),null,to_timestamp('21-JUL-16 07.16.42.000000000 PM','DD-MON-RR HH.MI.SS.FF AM'),'Para 1 Body', EMPTY_CLOB());
insert into wcm_article (ID,VERSION,ARTICLE_TYPE,NAME,HEADLINE,MAIN_IMAGE_ID,THUMBNAIL_IMAGE_ID,TITLE,DESCRIPTION,AUTHOR,POST_DATE,START_DATE,END_DATE,PARENT_FOLDER_ID,LAST_MOD_USER_ID,LAST_MOD_DATE,CREATION_USER_ID,CREATION_DATE,ARTICLE_BODY,ABSTRACT) values ('a30011',1,null,'Owatonna, MN Fleet Farm Store Map','Owatonna, MN Fleet Farm Store Map','m20012',null,null,null,null,null,null,null,null,null,to_timestamp('03-AUG-16 06.46.28.799000000 AM','DD-MON-RR HH.MI.SS.FF AM'),null,to_timestamp('21-JUL-16 03.00.44.000000000 PM','DD-MON-RR HH.MI.SS.FF AM'), EMPTY_CLOB(), EMPTY_CLOB());
insert into wcm_article (ID,VERSION,ARTICLE_TYPE,NAME,HEADLINE,MAIN_IMAGE_ID,THUMBNAIL_IMAGE_ID,TITLE,DESCRIPTION,AUTHOR,POST_DATE,START_DATE,END_DATE,PARENT_FOLDER_ID,LAST_MOD_USER_ID,LAST_MOD_DATE,CREATION_USER_ID,CREATION_DATE,ARTICLE_BODY,ABSTRACT) values ('a30021',1,null,'Alex - Para 2','Alexandria, MN Fleet Farm',null,null,null,null,null,null,null,null,null,null,to_timestamp('03-AUG-16 06.46.28.822000000 AM','DD-MON-RR HH.MI.SS.FF AM'),null,to_timestamp('21-JUL-16 06.50.31.000000000 PM','DD-MON-RR HH.MI.SS.FF AM'),'Fleet Farm in Alexandria, MN offers products for your home, lawn and garden, pets, farm, sporting goods, auto and ATV, clothing and footwear, tools needs, and more! Find what you need for home improvement, animal vaccines, hunting, fishing, horse tack, snacks, and many more necessity and "for fun" items. You''ll find products for all seasons at Fleet Farm. Get your garden off to a great start in the spring and keep it healthy and growing throughout the summer and fall with tillers, fertilizers, insect deterrents, garden hoses, garden tools, and all kinds of plants and garden planters from our garden center in Alexandria. Spruce up your yard for summer enjoyment with a new lawn mower, chain saw, swimming pool, water feature, or patio furniture. Rake and bag those fall leaves with garden tools, a leaf blower, and lawn and leaf bags. Be winter-ready with a new sled, snowblower, snow shovel, snow fencing, roof rake, weather stripping, a wood-burning stove, or a propane heater for extra warmth. Don''t forget your furry family members, either. Check out our full line of dog beds, dog and cat food, kennels, pet gates, collars, leashes, pet grooming supplies, and a selection of wild bird feed.', EMPTY_CLOB());
