insert into wcm_article (ID,VERSION,ARTICLE_TYPE,NAME,HEADLINE,MAIN_IMAGE_ID,THUMBNAIL_IMAGE_ID,TITLE,DESCRIPTION,AUTHOR,POST_DATE,START_DATE,END_DATE,PARENT_FOLDER_ID,LAST_MOD_USER_ID,LAST_MOD_DATE,CREATION_USER_ID,CREATION_DATE,ARTICLE_BODY,ABSTRACT) values ('a30025',1,null,'Alex-Para4','More Reasons to Shop Your Alexandria Fleet Farm',null,null,null,null,null,null,null,null,null,null,to_timestamp('03-AUG-16 06.46.28.936000000 AM','DD-MON-RR HH.MI.SS.FF AM'),null,to_timestamp('21-JUL-16 06.51.24.000000000 PM','DD-MON-RR HH.MI.SS.FF AM'),'Everyone has their favorite department at Fleet Farm stores. We haven''t left much out. You''ll find small appliances in our Home department, as well as cutlery, dishes, cookware, bakeware, office supplies, crafting supplies, home organization products, vacuums, cleaning products, clocks, candles, home decor, furniture, and paper products. The Farm department offers tractor seats, universal mufflers, implement parts, poultry supplies, beekeeping equipment, fencing supplies, post hole augers, pest control for rodents and insects, farm sprayers, veterinary supplies, and dairy supplies. Get items for the stable in our Horse Supplies department including bridles, bits, lead ropes, reins, lariats, fly control, pitchforks, riding helmets, saddle pads, horse training videos, and horse treats and toys. Did we mention apparel? Choose medical scrubs, work clothes for men, women''s work clothing, work boots, hunting boots, kids'' shoes, leather handbags, leather wallets, men''s belts, jeans, t-shirts, and coats and jackets from our Clothing and Footwear department. Don''t forget tools, either. We haven''t! Get wrenches, hammers, measuring tools, power tools, air compressors, log splitters, routers, power saws, table saws, welding equipment, wet/dry vacuums, caulk guns, and pressure washers in the Tools department. Find car parts, ATV accessories, tires, motorcycle saddlebags, snowmobile dollies, snowmobile helmets, snow goggles, garage accessories, and trailers in Auto and ATV. Shop toys for kids including farm toys, building blocks, crayons, play sets, riding toys, games, toy cars, dress-up costumes, puzzles, and more fun activities for kids in the Toys department! And then there are snacks. Lots of them. Pick up chocolates, licorice, peanuts, walnuts, cashews, mixed nuts, beef jerky, trail mix, popcorn, circus peanuts, candied nuts, salted-in-the-shell peanuts, pecans, and pistachios. If those items aren''t enough to pique your interest, consider that Fleet Farm in Alexandria, MN carries home improvement items including garage door openers, humidifiers, building supplies, plumbing supplies, lighting, fans, paint, stain, hardware, air conditioners, thermostats, gutters, and home security. In our Electronics Department, you can pick up batteries, cameras, DVD players, weather radios, walkie talkies, CB radios, antennas, scanners, media storage, computer peripherals, video cameras, headphones, and radar detectors. A great shopping experience includes service. Or more aptly, services. Fleet Farm offers a number of services in Alexandria. If you''d rather rent equipment than make a major investment, Fleet Farm in Alexandria, MN rents carpet cleaners, tillers, power tools, air compressors, pressure washers, generators, dollies, ladders, hoses, demolition equipment, electrical cords, and more. Get car repair, oil changes, tire repair, propane tank exchange, fuel, car washes, and pick up your hunting and fishing licenses at Fleet Farm. Shopping and services in one place means convenience for our customers. Have we left anything out? Plenty! Stop in and find what fits your needs at your Alexandria Fleet Farm!', EMPTY_CLOB());
